  // }, []);
  // const userExistsJSON = localStorage.getItem("CurrentUser");
  // const userExists = JSON.parse(userExistsJSON);
  // console.log(userExists);

  const [userExists, setUserExists] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      const userId = localStorage.getItem("userId");
      // Assuming you have an asynchronous function to fetch user data
      const userData = await fetchData(userId);
      setUserExists(userData);
    };

    fetchData();
  }, []); // Empty dependency array to run the effect only once

  if (!userExists) {
    // You might want to display a loading indicator or handle this state differently
    return <div>Loading...</div>;
  }

  const firstName = userExists.u_firstname;
  const lastName = userExists.u_lastname;
  const userName = userExists.u_name;
  const email = userExists.u_email;
  const password = userExists.u_pwd;
  const homeAddress = userExists.u_address;
  const homeZip = "30567";
  const homeState = "GA";
  const phone = userExists.u_phone;

  const cardNumber_1 = userExists.cc1;
  const cardName_1 = "Will Smith";

  const cardNumber_2 = userExists.cc2;
  const cardName_2 = "Bobby Lee";

  /* if card number is "" then I do not display: I am assuming that the card either has information or it is an empty string. I guess default make all credit card info contain empty string*/
  const cardNumber_3 = userExists.cc3;
  const cardName_3 = "";

  //   const firstName = "h";
  //   const lastName = "h";
  //   const userName = "h";
  //   const email = "h";
  //   const password = "h";
  //   const homeAddress = "h";
  //   const homeZip = "30567";
  //   const homeState = "GA";
  //   const phone = "h";

  //   const cardNumber_1 = "h";
