  //   const cardNumber_2 = "h";
  //   const cardName_2 = "Bobby Lee";

  //   /* if card number is "" then I do not display: I am assuming that the card either has information or it is an empty string. I guess default make all credit card info contain empty string*/
  //   const cardNumber_3 = "h";
  //   const cardName_3 = "";

  function removeCard_1(e) {
    /* remove credit card 1 */
    e.preventDefault();
  }
  function removeCard_2(e) {
    /* remove credit card 1 */
    e.preventDefault();
  }
  function removeCard_3(e) {
    /* remove credit card 1 */
    e.preventDefault();
  }
  function addCard_1(e) {}
  function addCard_2(e) {}
  function addCard_3(e) {}

  return (
    <body className="editP">
      <h1 style={{ paddingBottom: "20px" }}>Profile</h1>
      <div classname="firstName" style={{ paddingBottom: "10px" }}>
        First Name: {firstName}
      </div>
      <div classname="lastName" style={{ paddingBottom: "20px" }}>
        Last Name: {lastName}
      </div>
      <div classname="lastName" style={{ paddingBottom: "20px" }}>
        Username: {userName}
      </div>
      <div classname="email" style={{ paddingBottom: "20px" }}>
        Email: {email}
      </div>

      <div classname="homeAddress" style={{ paddingBottom: "20px" }}>
        <p>Home Address</p>
        <p>Street: {homeAddress}</p>
        <p>Zip: {homeZip}</p>
        <p>State: {homeState}</p>
      </div>

      <div classname="phone" style={{ paddingBottom: "20px" }}>
        Phone Number: {phone}
      </div>

      <div style={{ paddingBottom: "50px" }}>
        <a href="/editProfile">Edit Profile </a>
        <br />
      </div>

      <div classname="password" style={{ paddingBottom: "40px" }}>
        Password: {password}
        <a href="/changePassword"> Change Password </a>
        <br />
      </div>

      <div classname="phone" style={{ paddingBottom: "20px" }}>
        Payment Options
      </div>

      {cardNumber_1 !== "" && (
        <div classname="payment-info" style={{ paddingBottom: "20px" }}>
          <p>{cardName_1}</p>
          Card ending in: ****{}
          <p>
            <button onClick={removeCard_1} type="submit" style={{}}>
              Remove
            </button>
          </p>
        </div>
      )}
      {cardNumber_1 === "" && (
        <p>
          <button onClick={addCard_1} type="submit" style={{}}>
            Add Card
          </button>
        </p>
      )}

      {cardNumber_2 !== "" && (
        <div classname="payment-info" style={{ paddingBottom: "20px" }}>
          <p>{cardName_2}</p>
          Card ending in: ****{}
          <p>
            <button onClick={removeCard_2} type="submit" style={{}}>
              Remove
            </button>
          </p>
        </div>
      )}
      {cardNumber_2 === "" && (
        <p>
          <button onClick={addCard_2} type="submit" style={{}}>
            Add Card
          </button>
        </p>
      )}

      {cardNumber_3 !== "" && (
        <div classname="payment-info" style={{ paddingBottom: "20px" }}>
          <p>{cardName_3}</p>
          Card ending in: ****{}
          <p>
            <button onClick={removeCard_3} type="submit" style={{}}>
              Remove
            </button>
          </p>
        </div>
      )}
      {cardNumber_3 === "" && (
        <p>
          <button onClick={addCard_3} type="submit" style={{}}>
            Add Card
          </button>
        </p>
      )}
    </body>
  );
}
